package main

import "fmt"

func main() {
	slic := ""
	n := 0
	for i := 0; i < len(slic); i++ {
		if slic[i] != slic[i+1] && slic[i] != slic[i+2] && slic[i] != slic[i+3] {
			if slic[i+1] != slic[i+2] && slic[i+1] != slic[i+3] {
				if slic[i+2] != slic[i+3] {
					fmt.Println(i + 4)
					break
				}
			}
		}
	}
	m := 0
	k := 14
	for i := 0; i < len(slic)-14; i++ {

		for j := i + 1; j < i+k; j++ {
			if slic[i] != slic[j] {
				n++
			} else {
				n = 0
				break
			}
		}
		if n != 0 {
			m++
			k--
		} else {
			m = 0
			k = 14
		}
		if m == 14 {
			fmt.Println(i + 1)
			break
		}
	}
}
